INSERT INTO `messages` (`messageID`, `message`, `type`, `used`) VALUES
(3, 'watch out what you say! ''%term%'' is one o/t words #NSA looks for http://bit.ly/1bgUEWD', 1, '0000-00-00 00:00:00'),
(4, '#bigbrother is looking for people talking about ''%term%'' http://bit.ly/16dgAy0', 1, '0000-00-00 00:00:00'),
(5, 'A new term was added to our #NSA watchlist: ''%term%''', 2, '0000-00-00 00:00:00'),
(6, 'you used a word #NSA & #GCHQ are scanning internet for http://bit.ly/19eWaGU #%term%', 1, '0000-00-00 00:00:00'),
(7, 'are you aware governments are scanning internet for people using ''%term%''? http://bit.ly/14mkh3g', 1, '0000-00-00 00:00:00'),
(8, 'you''re probably no terrorist, but governments think you are because u used ''%term%'' http://bit.ly/K9WmyQ', 1, '0000-00-00 00:00:00'),
(9, 'Homeland Security is now keeping an eye on you now you used ''%term%'' http://bit.ly/xVvYV5', 1, '0000-00-00 00:00:00'),
(10, 'D''you know using ''%term%'' on social media triggers spies? http://bit.ly/K9WmyQ', 1, '0000-00-00 00:00:00'),
(11, 'don''t be scared, but by using ''%term%'' spy agencies will watch you http://huff.to/z0dB3P', 1, '0000-00-00 00:00:00'),
(12, 'using ''%term%'' automatically marks you as suspicious, d''you know that? http://onforb.es/KE4MvO Be careful!', 1, '0000-00-00 00:00:00'),
(13, 'd''you know ''%term%'' is one of the words terrorist use, according to US government? http://dailym.ai/KOyb4s', 1, '0000-00-00 00:00:00'),
(14, 'Yes, really, if you use ''%term%'' at social media, governments will keep an eye on you! #NSA #GCHQ #privacy #bigbrother', 2, '0000-00-00 00:00:00'),
(15, 'Check http://www.prism-break.org/ to protect yourself from gov''ts prying eyes (and don''t use #%term% in your tweets)!', 2, '0000-00-00 00:00:00'),
(16, 'Are #NSA, #GCHQ, Dept Homeland Security, #FBI the only gov''t agencies looking for terms like ''%term%''? Do you know any others?', 2, '0000-00-00 00:00:00');
